(function() {
    'use strict';

    // Change the name of this to the item you want

    var item = 'awp | redline';

     // Choose the number of the sound notification. 1-2

    var soundNumber = '1';

    // Create Notification Sound

    var player = document.createElement('audio');
    if(soundNumber == '1'){
        player.src = 'data:audio/mp3;base64,';
    }
    if(soundNumber == '2'){
        player.src = 'data:audio/mp3;base64,';
    }
    player.preload = 'auto';

    // Rest of the script

    if(document.body.innerHTML.toString().indexOf(item) > -1){
        player.play();
        setTimeout(function() {
            alert(item + " is in the store!");
            startStandby();
        }, 150);
    }else{
        setTimeout(function()
                   {
            location.reload(true);
        }, 4000);
    }
})();
